import React from 'react';
import './SearchUser.css'
import search from './search.svg'
import filtered from './filtered.svg'

const SearchUser: React.FC = () => {
    
    const [showModal,setShowModal] = use
    return (
        <div className='search-user'>
            <input className='input-search-user' placeholder='Введите имя, тег, почту...'></input>
            <img className='input-img-search' src={search} alt='search'></img>
            <img className='input-img-filtered' src={filtered} alt='search'></img>
        </div>
    );
};

export default SearchUser;
